import React, { Component } from 'react';

class Contain extends Component 
{  
  render() {
    return (
        <div>
            <div>
                <strong style="color:#fff;">
                    XXXXXXXX
                </strong>
            </div>
        </div>
    );
  }
}

export default Contain;
